import React from 'react';
import Listing from '../components/Listing';

const listings = [
  {
    id: 1,
    title: 'Beautiful 2 Bedroom Apartment',
    description: 'A lovely apartment with modern amenities.',
    price: '$1500/month',
    image: '../public/images/your_image.jpg', // Update with actual image paths
  },
  // Add more listings as needed
];

function Home() {
  return (
    <div className="container">
    <img src="/images/background.jpg" alt="Background" className="background-image" />
      <h1>Find Your Perfect Home</h1>
      <div>
        {listings.map(listing => (
          <Listing key={listing.id} listing={listing} />
        ))}
      </div>
    </div>
  );
}

export default Home;
